class ERC4626Target1DeployerContract(Contract):
    """A web3.py Contract class for the ERC4626Target1Deployer contract."""

    abi: ABI = erc4626target1deployer_abi
    bytecode: bytes = HexBytes(erc4626target1deployer_bytecode)

    def __init__(self, address: ChecksumAddress | None = None) -> None:
        try:
            # Initialize parent Contract class
            super().__init__(address=address)
            self.functions = ERC4626Target1DeployerContractFunctions(
                erc4626target1deployer_abi, self.w3, address
            )

        except FallbackNotFound:
            print("Fallback function not found. Continuing...")

    # TODO: add events
    # events: ERC20ContractEvents

    functions: ERC4626Target1DeployerContractFunctions

    @classmethod
    def factory(
        cls, w3: Web3, class_name: str | None = None, **kwargs: Any
    ) -> Type[Self]:
        contract = super().factory(w3, class_name, **kwargs)
        contract.functions = ERC4626Target1DeployerContractFunctions(
            erc4626target1deployer_abi, w3, None
        )

        return contract
